import { Router,Routes } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Router>
  <React.StrictMode>
  <Routes>
      <Route path="end" element={<End />} />
    </Routes>
    <App />
  </React.StrictMode>
  </Router>
);

